import React, { Component } from 'react'
import ContactKeepers from '../layout/ContactKeeper.png'

import AwesomeSlider from 'react-awesome-slider/src';
import CaptionedHoc from 'react-awesome-slider/src/hoc/captioned-images/hoc';
// import AutoplayHoc from 'src/hoc/autoplay/hoc';
import AwsSliderStyles from 'react-awesome-slider/src/core/styles.scss';
import CaptionedStyles from 'react-awesome-slider/src/hoc/captioned-images/styles.scss';
import AwesomeFrame from 'react-awesome-slider/src/components/react-awesome-frame';
import AwsFrameStyles from 'react-awesome-slider/src/components/react-awesome-frame/styles.scss';

const CaptionedSlider = CaptionedHoc(AwesomeSlider);
class ContactKeeper extends Component {

    

    render() {
        return (
            <React.Fragment>
                <CaptionedSlider
                    cssModule={[captionedStyles]}
                    screens={[
                        {
                          backgroundColor: '#4a9c8c',
                          media: '../layout/ContactKeeper.png',
                          caption: 'I want to see what you got.',
                        }
                      ]}
                  
                >
                </CaptionedSlider>

                <div className ="text-primary text-center">        
                    This is my first full stack application created for learning the back-end. 
                    I used postman for creating my API and use MongoDB to serve as my Cloud Database
                </div>
            </React.Fragment>
        )
    }
}
export default ContactKeeper
